"use strict";
class Insta {
    constructor(cameraMode, filter, storyMode) {
        this.cameraMode = cameraMode;
        this.filter = filter;
        this.storyMode = storyMode;
        this.cameraMode = cameraMode;
        this.filter = filter;
    }
}
class Youtube {
    constructor(cameraMode, filter, videoMode) {
        this.cameraMode = cameraMode;
        this.filter = filter;
        this.videoMode = videoMode;
        this.cameraMode = cameraMode;
        this.filter = filter;
    }
}
